import React from "react";
import ExpenseItem from "./ExpenseItem";
function expenseList(props) {
  if (props.item.length === 0) {
    return;
    <h1>No Expense Found</h1>;
  }
  return (
    <ul>
      props.items.map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        date={expense.date}
        amount={expense.amount}
      />
      ));
    </ul>
  );
}

export default ExpensesList;
